(function(g,moduleId,obj){
	var pcs = "DeeplModuleTrad";
	console.log(moduleId);
	var p = g.getProcessus(pcs, null);
	p.instantiate();
	var m = p.activate(); // start activities
	if (m.isOk())
	{
		// Select automation
		var actModule = m.get("Activity");
		m = p.lock(actModule.getActivity(), actModule.getAID());
		actModule.addDataFile("Field", "row_id", moduleId);
		var o = g.getProcessObject("Module");
		m = p.validate(actModule, o);

		var actLang =  m.get("Activity");
		m = p.lock(actLang.getActivity(), actLang.getAID());
		var action = obj.getAction("DeeAutoTraModule");
		actLang.setDataFile("Data", "tsl_lang",action.getConfirmField(g.getLang(), "tsl_lang").getValue());
		actLang.setDataFile("Data", "deeTrdLanguage", action.getConfirmField(g.getLang(), "deeTrdLanguage").getValue());
		m = p.validate(actLang, null);


		var next = m.get("Activity");
		p.lock(next.getActivity(), next.getAID());


	}

	return obj.sendRedirect(HTMLTool.getProcessStartURL(pcs));


})([GRANT],[ROWID],[OBJECT]);

(function(g,obj){
	var pcs = "DeeplListTra";
	var p = g.getProcessus(pcs, null);
	p.instantiate();
	var m = p.activate(); // start activities
	if (m.isOk())
	{
		// Select automation
		console.log("select: "+obj.getSelectedIds());
		var actObject = m.get("Activity");
		m = p.lock(actObject.getActivity(), actObject.getAID());
		console.log("prevalid: ");
		actObject.addDataFile("Field", "row_id");
		var selectedIDs =obj.getSelectedIds();
		console.log(selectedIDs);
		if (selectedIDs != null ){
			for (var i = 0; i < selectedIDs.size(); i++) {
				actObject.getDataFile("Field", "row_id", true).addValue(selectedIDs.get(i));
			}
		}else{
			rows = obj.search(); 
			console.log("rows: "+rows);
			for (var i = 0; i < rows.size(); i++){

				actObject.getDataFile("Field", "row_id", true).addValue(rows.get(i)[obj.getRowIdFieldIndex()]);

			}
		}
		m = p.validate(actObject, null);

		var actLang =  m.get("Activity");
